import React, {useEffect, useState} from "react";

function App() {

  const [backend, setBackend] = useState([{}]);
  const [show, setShow] = useState(false);

  useEffect(() => {
    fetch("/path/root").then(
      response => response.json()
    ).then(
      data => {
        setBackend(data)
        console.log(data)
      }
    )
  }, [])


  return (

    <div className="App">
      {(typeof backend.last_path === 'undefined') ? (
        <p>Loading...</p>
      ): (
        backend.last_path.map((children, i) => (
          <button type="button" key={i} onClick={()=>setShow(true)}>{i}{children}</button>
          // <p key={i}>{children}</p>
        ))

      )}
      /
    </div>
  );
}

export default App;
